import React from 'react';

function HomePageMockup() {
  const colors = {
    background: '#121212',
    gold: '#b68b2f',
    cream: '#f2f0e6',
    brown: '#6f4f2e'
  };

  return (
    <div
      style={{
        backgroundColor: colors.background,
        color: colors.cream,
        minHeight: '100vh',
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
        padding: '2rem'
      }}
    >
      {/* Header with logo */}
      <header
      style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        marginBottom: '2rem'
        }}
    >
        <div
    style={{
      boxShadow: '0 4px 10px rgba(0, 0, 0, 0.5)',
      borderRadius: '12px',
      overflow: 'hidden',
      width: '100px',
      height: '100px',
      marginBottom: '1rem',
      transition: 'transform 0.3s ease'
    }}
    onMouseEnter={e => {
      e.currentTarget.style.transform = 'scale(1.05)';
    }}
    onMouseLeave={e => {
      e.currentTarget.style.transform = 'scale(1)';
    }}
  >
    <img
      src="https://sleepercdn.com/avatars/thumbs/6ad52c4e61b556cd98322c5a7405378e"
      alt="League Logo"
      style={{ width: '100%', height: '100%', objectFit: 'cover', display: 'block' }}
    />
  </div>
  <h1
    style={{
      color: '#b68b2f',
      fontSize: '2.5rem',
      fontWeight: 'bold',
      letterSpacing: '0.1em',
      textAlign: 'center'
    }}
  >
    League of Ordinary Gentlemen
  </h1>
</header>

      {/* Ribbon */}
      <div
        style={{
          backgroundColor: colors.gold,
          color: colors.background,
          padding: '0.75rem 1.5rem',
          borderRadius: '30px',
          width: 'fit-content',
          margin: '0 auto 3rem auto',
          fontWeight: '600',
          letterSpacing: '0.1em',
          textTransform: 'uppercase',
          boxShadow: `0 0 15px ${colors.gold}`
        }}
      >
        Week 1 Matchup
      </div>

      {/* Matchup info */}
      <section style={{ maxWidth: '600px', margin: '0 auto' }}>
        <div
          style={{
            marginBottom: '1.25rem',
            padding: '0.5rem 0',
            fontWeight: '600',
            fontSize: '1.25rem',
            color: colors.gold,
            display: 'flex',
            justifyContent: 'space-between'
          }}
        >
          <span>TuckE71:</span> <span>0</span>
        </div>
        <div
          style={{
            marginBottom: '1.25rem',
            padding: '0.5rem 0',
            fontWeight: '600',
            fontSize: '1.25rem',
            color: colors.gold,
            display: 'flex',
            justifyContent: 'space-between'
          }}
        >
          <span>petehadley1712:</span> <span>0</span>
        </div>
        <div
          style={{
            fontSize: '1.25rem',
            textAlign: 'center',
            fontWeight: 'bold'
          }}
        >
          Result: <span style={{ color: colors.gold }}>Tied</span>
        </div>
      </section>

      {/* Footer */}
      <footer
        style={{
          textAlign: 'center',
          marginTop: '4rem',
          fontSize: '0.875rem',
          color: colors.brown,
          letterSpacing: '0.05em'
        }}
      >
        &copy; 2025 League of Ordinary Gentlemen
      </footer>
    </div>
  );
}

export default HomePageMockup;
